import axios from 'axios';

const baseUrl = 'http://challenge-react.alkemy.org/';
const baseUrl1 = 'http://localhost:8080/login';

export const loginUser = async ({ email, password }) => {
  try {
    const response = await axios({
      url: baseUrl,
      method: 'POST',
      data: {
        email: email,
        password: password,
      },
    });
    return response;
  } catch (error) {
    console.log(error);
  }
};

